(374, 'This mUjibur', 'this-mujibur', 'storage/post/3aYolNIiLYJYYB3S1iRzVtdAjh4Bm2QB6uHOlr11.png', 'থাকতেন। তাকে টাকার জন্য লাদেন নামের এক লোক প্রায় সময়<a href=\"https://www.pnsnews24.com/news/international/287520\" itemprop=\"url\">...বিস্তারিত</a>   <article itemscope=\"\" itemtype=\"http://schema.org/Article\" class=\"media infscr-item\"><a title=\"\" class=\"pull-left article-image\" href=\"https://www.pnsnews24.com/news/international/287515\"> <img src=\"https://www.pnsnews24.com/static/image/upload/news/2022/08/28/43b6f7221c9322f8b39fd5d1bdf53e14_18.jpg?w=260&amp;h=150\" data-src=\"/static/image/upload/news/2022/08/28/43b6f7221c9322f8b39fd5d1bdf53e14_18.jpg?w=260&amp;h=150\" class=\"media-object lazyloaded\" width=\"260\" height=\"150\"> </a> <div class=\"media-object\"> <h3 class=\"media-heading\" itemprop=\"headline name\"><a href=\"https://www.pnsnews24.com/news/international/287515\">পাকিস্তানের সত্যিকারের স্বাধীনতার জন্য লড়ছি, যুদ্ধের মধ্যেও কর্মসূচি চলবে: ইমরান</a></h3> <div class=\"publish-info\"><p><span class=\"glyphicon glyphicon-calendar\"></span>&nbsp;&nbsp;<span class=\"local-time\" data-time=\"2022-08-28T07:51:31Z\">গতকাল দুপুর ১:৫১ সময়</span></p> </div> <p itemprop=\"description\">পিএনএস\r\n ডেস্ক : পাকিস্তান বন্যায় বিপর্যস্ত। এর মধ্যে পাকিস্তানের সাবেক \r\nপ্রধানমন্ত্রী ইমরান খানের রাজনৈতিক কর্মসূচি আয়োজনের যৌক্তিকতা নিয়ে \r\nঅনেকেই প্রশ্ন তুলেছেন। সমালোচকদের কঠোর ভাষায় জবাব দিয়েছেন সাবেক এ তারকা \r\nক্রিকেটার। তিনি বলেছেন, ‘‘তিনি ‌পাকিস্তানের সত্যিকারের স্বাধীনতার জন্য \r\nলড়ছেন। তার এ লড়াই দাবদাহ, বন্যা এমনকি যুদ্ধেও অব্যাহত থাকবে’’।পাঞ্জাবের \r\nঝিলমে একটি জনসমাবেশে তিনি বলেন, বিরোধীরা তার দল পিটিআইয়ের বিরুদ্ধে \r\nচক্রান্ত করছে। ইমরান বলেন, “সংবাদপত্র, মিডিয়া, সাংবাদিক এবং একটি বিশেষ<a href=\"https://www.pnsnews24.com/news/international/287515\" itemprop=\"url\">...বিস্তারিত</a> </p> </div></article>', 1, 1, '2022-08-28 07:02:13', '2022-08-28 21:07:00');
